import React from 'react';
import {
  Link
} from "react-router-dom";
import { Table, Divider,Form, Select,Input,Button,DatePicker,Modal} from 'antd';


const FormItem = Form.Item;
const { Option } = Select;
const formItemLayout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 12 },
};

class ShopList extends React.Component {
    constructor(props) {
        super(props);
        this.state = { 
            visible: false
         };
    }

    showModal = () => {
      this.setState({
        visible: true,
      });
    };

    handleOk = e => {
      console.log(e);
      this.setState({
        visible: false,
      });
    };

    handleCancel = e => {
      console.log(e);
      this.setState({
        visible: false,
      });
    };
    onChange=(date, dateString)=>{
      console.log(date, dateString);
    }

    accounting=()=>{
      // this.showModal();
    }
    render() {
      const { form } = this.props;
      const { getFieldDecorator } = form;
        const columns = [
            {
              title: '订单编号',
              dataIndex: 'name',
              key: 'name',
            },
            {
              title: '订单原始费用',
              dataIndex: 'age',
              key: 'age',
            },
            {
              title: '自垫费用',
              dataIndex: 'address',
              key: 'address',
            },
            {
              title: '动态折扣',
              dataIndex: 'address',
              key: 'address',
            },
            {
              title: '订单立减',
              dataIndex: 'address',
              key: 'address',
            },
            {
              title: '分润比例',
              dataIndex: 'address',
              key: 'address',
            },
            {
              title: 'Action',
              key: 'action',
              render: (text, record) => (
                <span>

                 { <Button type="primary" onClick={this.showModal}>
          司机KPI
        </Button>}
          <Divider type="vertical" />
          { <Button type="primary" onClick={this.showModal}>
          财务对账
        </Button>}

                </span>
              ),
            },
          ];

          const data = [
            {
              key: '1',
              name: 'John Brown',
              age: 32,
              address: 'New York No. 1 Lake Park',
              tags: ['nice', 'developer'],
            },
            {
              key: '2',
              name: 'Jim Green',
              age: 42,
              address: 'London No. 1 Lake Park',
              tags: ['loser'],
            },
            {
              key: '3',
              name: 'Joe Black',
              age: 32,
              address: 'Sidney No. 1 Lake Park',
              tags: ['cool', 'teacher'],
            },
          ];

        return (
            <div className='info'> 
                <Modal
              title="Basic Modal"
              visible={this.state.visible}
              onOk={this.handleOk}
              onCancel={this.handleCancel}
            >
              <p>Some contents...</p>
              <p>Some contents...</p>
              <p>Some contents...</p>
            </Modal>
             <Form className="cc-table-filter" key="form" layout="inline">
             <FormItem {...formItemLayout} label="环境">
            {getFieldDecorator('evn', {
              initialValue: '',
              rules: [],
            })(<Select placeholder="" style={{ width: 140 }}>
              <Option value="0">33</Option>
              <Option value="1">44</Option>
              <Option value="2">stable</Option>
            </Select>)}
          </FormItem>
             <FormItem {...formItemLayout} label="订单号：">
            {getFieldDecorator('mockName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入订单编号" />)}
          </FormItem>
          <FormItem {...formItemLayout} label="乘客手机号">
            {getFieldDecorator('interfaceName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入乘客手机号" />)}
          </FormItem>
          <FormItem {...formItemLayout} label="司机手机号">
            {getFieldDecorator('interfaceName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入司机手机号" />)}
          </FormItem>
          <br />
          <DatePicker onChange={this.onChange} maxLength="100"/>

          <FormItem>
            <Button
              type="primary"
              htmlType="submit"
              onClick={() => this.onSearch(1)}
            >
查询
            </Button>
          </FormItem>
          <FormItem>
            <Button
              htmlType="submit"
              onClick={this.onReset}
            >
重置
            </Button>
          </FormItem>
        </Form>
        <Table columns={columns} dataSource={data} />

            </div>
        );
    }
}
const WrappedAdvancedSearchForm = Form.create()(ShopList);


export default WrappedAdvancedSearchForm;
